import React from "react";
import { YMaps, Map } from "react-yandex-maps";
import cl from './Loader.module.css'; 

const About = () => {
  return (
    <YMaps>
      <Map defaultState={{ center: [55.75, 37.57], zoom: 9 }} />
    </YMaps>
  );
};

export default About;
